import React, { useState } from 'react';

const TestUpdate = () => {
  
  const [courses, setCourses] = useState([]);
  const [typeOfTests, setTypeOfTests] = useState([]);

  const [testData, setTestData] = useState({
    testName: '',
    testStartDate: '',
    testEndDate: '',
    startTime: '',
    endTime: '',
    duration: '',
    totalQuestions: '',
    totalMarks: '',
    calculator: 'No',
    status: 'Inactive',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setTestData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add your logic for form submission here
    console.log('Form submitted with data:', testData);
  };

  return (
    <div>
      <h2>Test Update Form</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Test Name:
          <input
            type="text"
            name="testName"
            value={testData.testName}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Test Start Date:
          <input
            type="date"
            name="testStartDate"
            value={testData.testStartDate}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Test End Date:
          <input
            type="date"
            name="testEndDate"
            value={testData.testEndDate}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Start Time:
          <input
            type="time"
            name="startTime"
            value={testData.startTime}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          End Time:
          <input
            type="time"
            name="endTime"
            value={testData.endTime}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Duration (in minutes):
          <input
            type="text"
            name="duration"
            value={testData.duration}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Total Questions:
          <input
            type="text"
            name="totalQuestions"
            value={testData.totalQuestions}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Total Marks:
          <input
            type="text"
            name="totalMarks"
            value={testData.totalMarks}
            onChange={handleChange}
          />
        </label>
        <br />

        <label>
          Calculator:
          <select
            name="calculator"
            value={testData.calculator}
            onChange={handleChange}
          >
            <option value="Yes">Yes</option>
            <option value="No">No</option>
          </select>
        </label>
        <br />

        <label>
          Status:
          <select
            name="status"
            value={testData.status}
            onChange={handleChange}
          >
            <option value="Active">Active</option>
            <option value="Inactive">Inactive</option>
          </select>
        </label>
        <br />

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default TestUpdate;
